tables.table_schema:
CREATE TABLE UserInteractions (
    user_id UUID PRIMARY KEY,
    interaction_type VARCHAR(50),
    timestamp TIMESTAMP
);

CREATE TABLE WebsiteUsability (
    page_id UUID PRIMARY KEY,
    user_id UUID,
    time_spent INT,
    unique_views INT
);

CREATE TABLE UserFeedback (
    feedback_id INT PRIMARY KEY,
    user_id INT,
    feedback_text TEXT,
    feedback_date DATE
);

CREATE TABLE PageStatistics (
    page_id INT PRIMARY KEY,
    page_url VARCHAR(255),
    average_duration_sec INT,
    total_interactions INT
);

CREATE TABLE user_logs (
  user_id UUID,
  action VARCHAR,
  timestamp TIMESTAMP
);

CREATE TABLE page_views (
  page_id UUID,
  user_id UUID,
  timestamp TIMESTAMP,
  duration INT
);

CREATE TABLE user_profiles (
  user_id UUID,
  username VARCHAR,
  email VARCHAR,
  created_at TIMESTAMP
);

CREATE TABLE user_feedback (
  feedback_id UUID,
  user_id UUID,
  feedback_text TEXT,
  rating INT
);
